INSERT INTO `catalog_pages` VALUES (277, 4, 'Gezelschapsdieren', 'Gezelschapsdieren', 'pets3', 1, 8, 1, 1, '1', '1', '0', '0', 'catalog_pet_headline1_en', 'ctlg_pet_note', '', 'Pets are inhabitants of Habbo Hotel so each pet owner needs to know a bit about them. If you want to look after your pet properly, make sure you read the following points carefully.', 'A few things you should know:', '*You can place a pet in your room or take one for a walk with you in other rooms.\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\n*You can have up to 50 pets in your room, but look after them all!\n\n\n*Look after your pet with food, water and treats. Check the Pets\' Accessories.\n*Unlock Badges and Achievements by Training your Pet.', 'Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!', 0, '');
INSERT INTO `catalog_pages` VALUES (18, 568, 'Lodge', 'Lodge', 'default_3x3', 1, 37, 1, 6, '1', '1', '0', '0', 'catalog_lodge_headline1', 'catalog_lodge_teaser1', '', 'For that splendid ski-lodge effect with an open fire and whisky on the sidebar. This range is for those who appreicate the true beauty of solid wood.', '', '', '', 0, '');
