INSERT INTO `catalog_pages` VALUES (78, 277, 'Terriers', 'Terriers', 'pets', 1, 66, 1, 7, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'The Cairn Terrier is one of the oldest terrier breeds. From the Scottish Highlands, it was used for hunting prey among the cairns! Different breeds have different colours!', 'Name your Terrier:', 'Pick a colour:', 'Pick a breed:\n', 0, '');
INSERT INTO `catalog_pages` VALUES (79, 277, 'Beren', 'Beren', 'pets', 1, 68, 1, 5, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'A large mammal that walks on the soles of its feet, with thick fur and a short tail. Did you know that bears are related to dogs and that most species are omnivorous?', 'Name your Bear:', NULL, 'Pick a breed:', 0, '');
INSERT INTO `catalog_pages` VALUES (80, 277, 'Varkens', 'Varkens', 'pets', 1, 67, 1, 15, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'Finally an excuse to leave your room looking like a pigsty! Mischevious and cute, these little guys are out of the ordinary. Sweet and funny, a pet like no other!', 'Name your Pet Pig:', 'Pick a colour:', 'Pick a breed:\n', 0, '');
INSERT INTO `catalog_pages` VALUES (523, 219, 'Voetbal', 'Voetbal', 'default_3x3', 1, 56, 1, 6, '1', '1', '0', '0', 'catalog_football_001', 'flags', '', 'Whether you call it soccer, football or futbol... you can enjoy the game right here in Habbo! Get a ball and kick it, bounce it, pass it, control it and steal it!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (54, 209, 'Gevangenis', 'Gevangenis', 'default_3x3', 1, 240, 1, 57, '1', '1', '0', '0', 'prisonheader', 'prisonteaser', '', 'Hey, he\'s escaping! Just kidding, no one\'s getting out of these high security cells!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (55, 209, 'TV Studio', 'TV Studio', 'default_3x3', 1, 136, 1, 76, '1', '1', '0', '0', 'header_studio', 'teaser_studio', '', 'The Studio range lets YOU be your own music producer!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (81, 277, 'Leeuw', 'Leeuw', 'pets', 1, 76, 1, 8, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'A boisterous predator in nature, the lion has been tamed to be your fierce friend in Habbo Hotel.', 'Name your pet:', 'Choose a colour:', 'Choose a breed:\n', 0, '');
INSERT INTO `catalog_pages` VALUES (82, 277, 'Neushoorn', 'Neushoorn', 'pets', 1, 77, 1, 11, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'The Rhinoceros is an African herbivore that can weigh over a ton. It is proud and slightly aloof, but loyal and never let anything get in the way of a good time!', 'Name your pet:', 'Choose a colour:', 'Choose a breed:', 0, '');
INSERT INTO `catalog_pages` VALUES (83, 277, 'Spin', 'Spin', 'pets', 1, 95, 1, 12, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'One of the most feared creatures in nature, and perhaps the most misunderstood. The majority of Spiders have sharp fangs that inject venom into their prey- but don\'t worry, these spiders won\'t bite! Maybe...', '', 'Name your pet:', '', 0, '');
INSERT INTO `catalog_pages` VALUES (84, 277, 'Schildpad', 'Schildpad', 'pets', 1, 126, 1, 9, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'Anything but slow, these guys are ready to ride the waves and swim laps at your beaches!', '', 'Name your Turtle:', NULL, 0, '');
