INSERT INTO `catalog_pages` VALUES (58, 442, 'American Idol', 'American Idol', 'default_3x3', 1, 52, 4, 3, '1', '1', '0', '0', 'catalog_header_AI1_en', 'catalog_teaser_idol', '', 'Host your own American Idol show with this replica furniture! All that\'s missing is a Randy Jackson lookalike!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (59, 209, 'Keuken', 'Keuken', 'default_3x3', 1, 217, 1, 41, '1', '1', '0', '0', 'catalog_header_kitchen2015', 'teaser_kitchen2015', '', 'Fancy owning a Habbo restaurant? Or just love catering for Habbos in style? With this furni line you can REALLY get cooking!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (86, 277, 'Kikker', 'Kikker', 'pets', 1, 97, 1, 16, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'Cute, green and slimy! Frogs come in a variety of colours and can be found all over the world. They are great jumpers and make great pets, but are harder to hold onto than a supermodel in a tornado.', '', 'Name your Frog:', NULL, 0, '');
INSERT INTO `catalog_pages` VALUES (87, 277, 'Draken', 'Draken', 'pets', 1, 109, 1, 6, '1', '1', '0', '0', 'catalog_pet_headline1', '', '', 'Keepers of the Dragon, beware...their history is legendary... With their fiery breath and scaly skin, these mythical creatures are nothing but fierce!', '', 'Name your Dragon:', NULL, 0, '');
INSERT INTO `catalog_pages` VALUES (60, 209, 'USVA', 'USVA', 'default_3x3', 1, 129, 1, 78, '1', '1', '0', '0', 'catalog_header_USVA', 'Catalog_teaser_USVA', '', 'With a great range of colours and new stacking possibilities, you\'ll love building and creating structures with the new USVA Furni line!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (279, 503, 'Jet Set', 'Jet Set', 'default_3x3', 1, 237, 1, 1, '1', '1', '0', '0', 'jetset_header', 'jetset_cashcomp2', '', 'Are you ready for the launch of the new Jet Set series? We are! Get ready to ride the waves on your yacht or jet ski and just relax in a tropical paradise.', '', '', '', 0, '');
