INSERT INTO `catalog_pages` VALUES (65, 218, 'Voorwaarden', 'Voorwaarden', 'default_3x3', 1, 83, 1, 5, '1', '1', '0', '0', 'catalog_wired_header4_en', 'ctlg_pic_wired_conditions', '', 'Conditions are specific things that need to be done before a Trigger will work. If you want to use a Condition, you will need to stack it with a Trigger and Effect.', NULL, '', 'Click on an item to see what the Condition does!', 0, '');
