INSERT INTO `catalog_pages` VALUES (107, 2, 'Epicnabbo Groepen', 'Epicnabbo Groepen', 'guilds', 1, 203, 1, 15, '1', '1', '0', '0', 'catalog_groups_en', 'catalog_groupsteaser_en', '', 'Habbo Groups are a great way to stay in touch with your friends and share your interests with others. Each Group has a homeroom that can be decorated by other Group members, members can also purchase exclusive Group Furni that can be customised with your Group colours!', '', '* Get together with people you get together with!\r\n* Co-op room decorating for group members\r\n* Show off your group badge!\r\n* Get some neat Furni in your group\'s colours!', 'What\'s So Great About Habbo Groups?', 0, '');
