INSERT INTO `catalog_pages` VALUES (163, 107, 'Groep Forums', 'Groep Forums', 'guild_forum', 1, 207, 1, 2, '1', '1', '0', '0', 'catalog_groups_en', '', '', 'Group Forums are here!', '', '<b><font color=\"#0e3f52\" size=\"16\">What are Group Forums?</font></b>\r\n\r\nForums allow you to effortlessly post, comment and discuss topics freely, without even leaving the Hotel!\n\n<i><b><font color=\"#0e3f52\" size=\"16\">Who can start a forum? </font></b></i>\n\nOnly a group owner can start a forum for their group.\n\n<i><b><font color=\"#0e3f52\" size=\"16\">Do I need a Forum Terminal?</font></b></i>\n\nYes - In order to start a Group Forum the group owner must first purchase a forum terminal for the group.\n\n\nFind out more about Group Forums <a href=\"event:habbopages/forums\">here</a>.\n\nPlease note, we will continue to add more functionalities to this feature in the near future.', '', 0, '');
