INSERT INTO `catalog_pages` VALUES (219, 2, 'Spel Winkel', 'Spel Winkel', 'pets3', 1, 202, 1, 14, '1', '1', '0', '0', 'game_shop_header', 'game_shop_teaser', '', 'Get your gamer gear on!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (220, 2, 'Marktplaats', 'Marktplaats', 'pets3', 1, 69, 1, 17, '1', '1', '0', '0', 'catalog_marketplace_header_en', 'catalog_note_marketplace', '', 'Habbo Marketplace is a convenient and safe way to buy and sell items in Habbo.', 'How does the Habbo Marketplace work?', 'Buying items: Browse for the item you want to buy on the Marketplace Offers page and click Buy. We guarantee you\'ll get the item at the cheapest price available at the moment of purchase. No requirements needed.\r\n\r\nSelling items: You can sell any item which is tradable by selecting the item in your inventory and clicking on \'Sell in Marketplace\'. You also can use items currently in the Shop.\r\n\r\nNOTE: you can only sell 250 furni at a time.\r\n\r\nRequirements: To sell your Furni in the Marketplace you\'ll need a Trading Pass, which you can get completing the first steps of the Talent Track.', '', 0, '');
INSERT INTO `catalog_pages` VALUES (221, 4, 'Baby huisdieren', 'Baby huisdieren', 'pets3', 1, 228, 1, 2, '1', '1', '0', '0', 'babypets_cata_header', 'ctlg_babypet_note', '', 'They\'re friendly. They\'re cute. They\'re here to win your hearts. Who are they? Baby pets! ALL NEW Kittens, puppies, piglets are storming their way through the hotel and joining the Bear Cubs and Terriers. Available via breeding boxes or sale.', 'A few things you should know:', '*You can place a pet in your room or take one for a walk with you in other rooms.\n*You can\'t trade your pet but they can follow you to friend\'s rooms to gather scratches.\n*You can have up to 50 pets in your room, but look after them all!\n\n\n*Look after your pet with food, water and treats.\nCheck the Pets\' Accessories.\n*Unlock Badges and Achievements by Training your Pet.', 'Click your Pet and hit the \"Train\" button to get a list of commands that will level up your Pet in no time!', 0, '');
