INSERT INTO `catalog_pages` VALUES (222, 5, 'Builders Club', 'Builders Club', 'pets3', 1, 28, 1, 1, '1', '1', '0', '0', 'block_header', 'ctlg_bclub_note', '', '1 Block... 2 Block... Red Block... Blue Block!', '1 Block... 2 Block... Red\r\nBlock... Blue Block!', '\r\n\r\nWith dozens of all the colours and patterns to choose from, you can really let your creativity run wild!\r\nExclusive to Builders Club.', '', 0, '');
