INSERT INTO `catalog_pages` VALUES (224, 604, 'Teleporters', 'Teleporters', 'default_3x3', 1, 120, 1, 8, '1', '1', '0', '0', 'catalog_doors_headline1', 'catalog_door_a', '', 'Beam yourself from one room to another with our space-age teleports. Buy a pair, put one in each room and you\'ve got your own suite! IMPORTANT: teleports are always sold in pairs except for the Random Banzai Teleport.', '', NULL, 'Click on an item for details.', 0, '');
INSERT INTO `catalog_pages` VALUES (225, 604, 'Trofeeën', 'Trofeeën', 'trophies', 1, 221, 1, 11, '1', '1', '0', '0', 'trophies', '', '', 'Everyone\'s a winner, baby! And now you can reward them all with our fabulous glittering array of bronze, silver and gold trophies.\n\nFirst choose the trophy model by click the arrows. Then select the metal. Type your inscription below and we\'ll engrave it on the trophy along with your name and today\'s date.\nRemember - it\'s permanent!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (473, 373, 'Classics', 'Classics', 'default_3x3', 1, 168, 1, 0, '1', '1', '0', '0', 'catalog_header_xmas2013', 'catalog_xmas_teaser', '', 'Christmas trees, poinsettas, and decorations. Back to the good old classic Christmas furni!', '', '', '', 0, '');
