INSERT INTO `catalog_pages` VALUES (499, 498, 'Ecotron Rewards II', 'Ecotron Rewards II', 'default_3x3', 1, 163, 1, 2, '0', '0', '0', '0', '', '', '', '', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (227, 219, 'Hoe speel je Banzai', 'Hoe speel je Banzai', 'pets2', 1, 42, 1, 2, '0', '0', '0', '0', 'catalog_battleBanzai_header_en', 'catalog_battleBanzai_teaser', '', 'So how does it work? Read the instructions here and you\'ll be Banzai-ing in no time!', 'How to create your own \nBattle Banzai Arena:', '1. In your room, place Banzai tiles on the floor and barriers the playing field\r\n\r\n2. Add a Team portal for each team (max 4: blue,\r\npink, yellow, and green)\r\n \r\n3. Place a Counter and Scoreboards on the playing field\r\n\r\n4. Click the Counter to launch the game!\r\n\r\n5.Jump on the tiles to colour them, jump 3 times to lock - team with most points win!\r\n\r\n\r\n\r\n\r\nTip: Add drama with Pyramids, Dragons and Pucks - they work as obstacles and helpers!', '', 0, '');
INSERT INTO `catalog_pages` VALUES (380, 374, 'Pasen 2013', 'Pasen 2013', 'default_3x3', 1, 181, 1, 5, '1', '1', '0', '0', 'easter13_header', 'easter13_teaser', '', 'This line brings flowers, teleports and a couple of eggs with it. Check out the floral-inspired line below!', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (381, 374, 'Pasen 2014', 'Pasen 2014', 'default_3x3', 1, 181, 1, 6, '1', '1', '0', '0', 'catalog_header_easter14_001', 'easternew', '', 'From shape shifting wall pieces to cryptic teleports, this years Easter furni line is sure to keep you guessing! Nothing is as it seems on this mind-bending island...', '', '', '', 0, '');
INSERT INTO `catalog_pages` VALUES (228, 219, 'Hoe speel je Freeze!', 'How to Play Freeze!', 'pets2', 1, 42, 1, 4, '0', '0', '0', '0', 'catalog_freeze_en', 'ctlg_pet_note', '', 'Find out how you can make and host your own Freeze! game by reading the instructions below!', 'How to play Freeze!', '1. Place Tiles and Blocks in your room. Always place blocks on top of tiles! Add Team Gates, a Counter, an Exit Tile and Scoreboards.\n\n2. Ready? Let your friends choose a team. Each team can have up to five players. Then click the Counter\nto start!\n \n3. To place a Snowball, double click on the tile that you are standing on, or double click on a tile next to you. Blow up Blocks for power-ups!\n\n4. Last team standing wins!\n\n\n\n\nRemember: You will be warped to an Exit Tile when you lose all your lives.', '', 0, '');
